import pythonmemorymodule
import base64
import ctypes

buf2 = base64.b64decode('')

with open('dll.dll', 'rb') as f:
    buf2 = f.read()

dll2 = pythonmemorymodule.MemoryModule(data=buf2, debug=False)
func = dll2.get_proc_addr('AddNumbers')
func.argtypes = [ctypes.c_int, ctypes.c_int]  
func.restype = ctypes.c_int  

result = func(5, 10)


